import React, { Component } from 'react'
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'
import '../../styles/main.css'
import csharp from '../../assets/csharp-logo.svg'

class Home extends Component {
  render() {
    return(
      <Parallax pages={2} ref={ref => (this.parallax = ref)}>
        <ParallaxLayer offset={0} speed={1} className='colorApp'/>

        <ParallaxLayer offset={0.3} speed={0.3} style={{pointerEvents: 'none'}}>
          <img src={csharp} className="csharp-logo"/>
        </ParallaxLayer>
      </Parallax>
    )
  }
}

export default Home
